import React, { useState, useEffect } from 'react';
import './App.css';

function Video({ video, index }) {
  return (
    <div key={index}>
      <h2>{`Video ${index + 1}`}</h2>
      <video width="500" controls>
        <source src={video} type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <br />
    </div>
  );
}

function Garage() {
  const [vids, setVids] = useState([
    "./uploads/0001-0030.mp4",
    "./uploads/0001-0250.mp4",
    "./uploads/3.mp4",
    "./uploads/2.mp4",
    "./uploads/5.mp4",
    "/uploads/0001-0072.mp4",
  ]);

  useEffect(() => {
    fetch('http://localhost:3001/api/data')
      .then((response) => response.json())
      .then((result) => {
        setVids(result.response); // Update the state
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []); // Run only once on component mount

  return (
    <div>
      {vids.map((video, index) => (
        <Video key={index} video={video} index={index} />
      ))}
    </div>
  );
}

function App() {
  return (
    <div>
      <a href="./upload.html">Upload Video</a>
      <h1>Yubtub</h1>
      <h2>Random Videos</h2>
      <Garage />
    </div>
  );
}

export default App;
